import React, { useState, useEffect } from "react";
import API from "../api/api";

const AdminDashboard = () => {
  const [candidates, setCandidates] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  // Form state
  const [form, setForm] = useState({
    name: "",
    university: "",
    school: "",
    department: "",
    year: "",
    position: "",
  });

  const [editingId, setEditingId] = useState(null);

  // Fetch all candidates
  useEffect(() => {
    const fetchCandidates = async () => {
      try {
        const res = await API.get("/candidates");
        setCandidates(res.data);
        setLoading(false);
      } catch (err) {
        console.error(err);
        setError(err.response?.data?.message || "Failed to fetch candidates");
        setLoading(false);
      }
    };

    fetchCandidates();
  }, []);

  // Handle form input changes
  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  // Add or Update candidate
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      if (editingId) {
        // ✅ Update candidate
        const res = await API.put(`/candidates/${editingId}`, form);
        setCandidates(
          candidates.map((c) => (c._id === editingId ? res.data : c))
        );
        setEditingId(null);
      } else {
        // ✅ Add new candidate
        const res = await API.post("/candidates", form);
        setCandidates([...candidates, res.data]);
      }
      setForm({
        name: "",
        university: "",
        school: "",
        department: "",
        year: "",
        position: "",
      });
    } catch (err) {
      alert(err.response?.data?.message || "Failed to save candidate");
    }
  };

  // Delete candidate
  const handleDelete = async (id) => {
    try {
      await API.delete(`/candidates/${id}`);
      setCandidates(candidates.filter((c) => c._id !== id));
    } catch (err) {
      alert(err.response?.data?.message || "Failed to delete candidate");
    }
  };

  // Edit candidate → populate form
  const handleEdit = (c) => {
    setForm({
      name: c.name,
      university: c.university,
      school: c.school,
      department: c.department,
      year: c.year,
      position: c.position,
    });
    setEditingId(c._id);
  };

  if (loading) return <p>Loading candidates...</p>;
  if (error) return <p style={{ color: "red" }}>{error}</p>;

  return (
    <div>
      <h1>Admin Dashboard</h1>

      <h2>{editingId ? "Edit Candidate" : "Add Candidate"}</h2>
      <form onSubmit={handleSubmit}>
        <input name="name" placeholder="Name" value={form.name} onChange={handleChange} required />
        <input name="university" placeholder="University" value={form.university} onChange={handleChange} required />
        <input name="school" placeholder="School" value={form.school} onChange={handleChange} required />
        <input name="department" placeholder="Department" value={form.department} onChange={handleChange} required />
        <input name="year" placeholder="Year" value={form.year} onChange={handleChange} required />
        <input name="position" placeholder="Position" value={form.position} onChange={handleChange} required />
        <button type="submit">{editingId ? "Update" : "Add"} Candidate</button>
      </form>

      <h2>All Candidates</h2>
      <ul>
        {candidates.map((c) => (
          <li key={c._id}>
            {c.name} | {c.university} | {c.school} | {c.department} | {c.year} | {c.position}
            <button onClick={() => handleEdit(c)} style={{ marginLeft: "10px" }}>Edit</button>
            <button onClick={() => handleDelete(c._id)} style={{ marginLeft: "5px" }}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default AdminDashboard;
